import styled from 'styled-components'
import {ReactComponent as MarkerSVG} from '../../assets/landlines_marker.svg'

export const Marker = styled(MarkerSVG)`
    display: block;
  border: none;
  background-size: cover;
  width: 20px;
  height: 20px;
  cursor: pointer;
  color: #fff;
  font-size: 14px;
  text-align: left;
  font-weight: 800;
  position: relative;

`

export const MarkerWrapper = styled.div``
